import React from "react";
import Featurebox from "./Featurebox";
import figure1 from "../images/1.svg";
import figure2 from "../images/2.svg";
import figure3 from "../images/3.svg";
import figure4 from "../images/4.svg";
function Feature() {
  return (
    <div id="features">
      <h1>TRAININGS </h1>
      <div className="a-container">
        <Featurebox image={figure1} title="Gym training" />
        <Featurebox image={figure2} title="Excercises" />
        <Featurebox image={figure3} title="Balance Diet" />
        <Featurebox image={figure4} title="Mentoring Track" />
      </div>
    </div>
  );
}

export default Feature;
